import React from 'react';
import './Phone.css';
import Media from 'react-media';
import { doc, onSnapshot, collection, getDocs } from "firebase/firestore";
import { db } from '../../firebase';

let pushArray = new Array();

// Phone Component 
export default function ReturnPhone() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-user-client-phone'>
  <VieWPhone />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-user-client-phone-sm'>
  <VieWPhone />
 </div>
);
export const VieWPhone = () => {

 const [phone, setPhone] = React.useState('');

 React.useEffect(async () => {
  setPhone(window.localStorage.getItem('PHONE_USER_REMOVE'))

 }, []);

 return (
  <h2>{JSON.parse(phone)}</h2>
 );
};
